window.bookSummaryJSON = "<p><b>'A writer of almost cinematic talent' DAILY EXPRESS</b><br> <br> <b>EVERY OPERATIVE KNOWS THE RULES.</b><br> <b>The mission comes first. You are a deniable asset. Betrayal is punished by death.</b><br> <br> Alex Reeve - OPERATIVE 66 - is a former special-ops soldier and one of the UK's most deadly weapons. Once a member of SC9, a covert assassination unit, Reeve was framed for treason and now works as a mercenary - while the cold-blooded killers he trained with continue their ruthless pursuit.<br> <br> To be reunited with the woman he loves, Reeve must bring down SC9 - but only a lone British politician can help expose them. As SC9's Operatives close their lethal net, Reeve and those he has to protect are plunged into terrible danger.<br> <br> Reeve must rely on his instincts and expert training to have any chance of survival. But if there's one man that can never be underestimated . . . it is Operative 66.</p>"; 
